INSERT INTO `wpsrt_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(1, 1, '2016-12-23 23:43:23', '2016-12-23 20:43:23', 'Добро пожаловать в WordPress. Это ваша первая запись. Отредактируйте или удалите её, затем пишите!', 'Привет, мир!', '', 'publish', 'open', 'open', '', 'privet-mir', '', '', '2016-12-23 23:43:23', '2016-12-23 20:43:23', '', 0, 'http://dressshop.website/?p=1', 0, 'post', '', 1),
(2, 1, '2016-12-23 23:43:23', '2016-12-23 20:43:23', 'Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице &laquo;Детали&raquo; владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:\n\n<blockquote>Привет! Днём я курьер, а вечером &#8212; подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</blockquote>\n\n...или так:\n\n<blockquote>Компания &laquo;Штучки XYZ&raquo; была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</blockquote>\n\nПерейдите <a href="http://dressshop.website/wp-admin/">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!', 'Пример страницы', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2016-12-23 23:43:23', '2016-12-23 20:43:23', '', 0, 'http://dressshop.website/?page_id=2', 0, 'page', '', 0),
(5, 1, '2016-12-23 23:51:08', '2016-12-23 20:51:08', '', 'Latest Products', '', 'publish', 'closed', 'closed', '', 'shop', '', '', '2017-06-25 08:48:07', '2017-06-25 05:48:07', '', 0, 'http://dressshop.website/shop/', 0, 'page', '', 0),
(6, 1, '2016-12-23 23:51:08', '2016-12-23 20:51:08', '[woocommerce_cart]', 'Корзина', '', 'publish', 'closed', 'closed', '', 'cart', '', '', '2016-12-23 23:51:08', '2016-12-23 20:51:08', '', 0, 'http://dressshop.website/cart/', 0, 'page', '', 0),
(7, 1, '2016-12-23 23:51:08', '2016-12-23 20:51:08', '[woocommerce_checkout]', 'Оформление заказа', '', 'publish', 'closed', 'closed', '', 'checkout', '', '', '2016-12-23 23:51:08', '2016-12-23 20:51:08', '', 0, 'http://dressshop.website/checkout/', 0, 'page', '', 0),
